import React, { useLocation } from 'react';

function PaymentPage() {
    const location = useLocation();  // Access the location object to get the passed state
    const { certName } = location.state || {};  // Extract certName from the state

    return (
        <div style={{ padding: '20px' }}>
            <h1 style={{ textAlign: 'center' }}>Payment Page</h1>
            {certName && (
                <p style={{ textAlign: 'center', fontSize: '18px' }}>
                    You are applying for the certification: <strong>{certName}</strong>
                </p>
            )}
            {/* Your payment gateway logic goes here */}
        </div>
    );
}

export default PaymentPage;
